def findTheString(lcp: List[List[int]]) -> str:
    alphabet = [chr(i + ord("a")) for i in range(26)]

    def choose_diff_char(diff):
        for c in alphabet:
            if c not in diff:
                return c
        return ""

    def check_valid_lcp(lcp):
        for i in range(len(lcp)):
            if lcp[i][i] != len(lcp) - i:
                return False
            for j in range(i):
