                    return False
                if i == len(lcp) - 1:
                    next_value = 0
                else:
                    next_value = lcp[i + 1][j + 1]

                if lcp[i][j] != 0 and lcp[i][j] != next_value + 1:
                    return False
        return True

    res = ""
    if not check_valid_lcp(lcp):
        return ""

    for i in range(len(lcp)):
        exact = set()
        diff = set()
        for j in range(i):
            if lcp[i][j] > 0:
                exact.add(res[j])
            else:
                diff.add(res[j])
        if len(exact) > 1:
            return ""
        if len(exact) == 1:
            res += list(exact)[0]
            if res[i] in diff:
                return ""
        if len(exact) == 0:
            c = choose_diff_char(diff)
            if c == "":
                return ""
            res += c

    return res

