def componentValue(nums: List[int], edges: List[List[int]]) -> int:
    kMax = 1000000000
    n = len(nums)
    summ = sum(nums)
    tree = [[] for _ in range(n)]
    for u, v in edges:
        tree[u].append(v)
        tree[v].append(u)

    def dfs(u: int, target: int, seen: Set[bool]) -> int:
        "\n      Returns the sum of the subtree rooted at u substracting the sum of the\n      deleted subtrees.\n"
        summ = nums[u]
        seen.add(u)
        for v in tree[u]:
            if v in seen:
                continue
            summ += dfs(v, target, seen)
            if summ > target:
                return kMax
        if summ == target:
            return 0
        return summ

    for i in range(n, 1, (-1)):
        if ((summ % i) == 0) and (dfs(0, (summ // i), set()) == 0):
            return i - 1
    return 0

